import React, { useState, useEffect } from 'react';
import api from '../api'; // Assuming this exists and handles API calls

export default function Dashboard({ products: initialProducts = [], onStockChange }) {
  const [products, setProducts] = useState(initialProducts);
  const [editStock, setEditStock] = useState({}); // { productId: editingValue }

  useEffect(() => {
    setProducts(initialProducts);
  }, [initialProducts]);

  const totalItems = products.length;
  const totalStock = products.reduce((s, p) => s + Number(p.quantity || 0), 0);
  const lowStock = products.filter(p => Number(p.quantity || 0) <= 5).length;

  const handleImageError = (e) => {
    e.target.src = 'https://via.placeholder.com/150?text=Image+Not+Available';
  };

  // When user edits stock field
  const handleStockChange = (id, value) => {
    // Allow only numbers >= 0
    if (/^\d*$/.test(value)) {
      setEditStock(prev => ({ ...prev, [id]: value }));
    }
  };

  // Save edited stock to backend & update local state
  const saveStock = async (id) => {
    const newStockValue = Number(editStock[id]);
    if (isNaN(newStockValue)) return;

    try {
      // Find product to update
      const productToUpdate = products.find(p => p.id === id);
      if (!productToUpdate) return;

      // Mock API call to update stock
      await api.put(`/products/${id}`, { ...productToUpdate, quantity: newStockValue });

      // Update local state
      setProducts(products.map(p => p.id === id ? { ...p, quantity: newStockValue } : p));

      // Clear edit input for that product
      setEditStock(prev => {
        const copy = { ...prev };
        delete copy[id];
        return copy;
      });

      // Notify parent if needed
      if (onStockChange) onStockChange(id, newStockValue);
    } catch (error) {
      console.error('Failed to save stock:', error);
      alert('Failed to save stock. Try again later.');
    }
  };

  return (
    <div className="dashboard card">
      <h3>Dashboard Overview</h3>
      <div className="summary-cards" style={{ display: 'flex', gap: '1rem' }}>
        <div className="summary-card" style={{ flex: 1 }}>
          <h4>Total Items</h4>
          <p><strong>{totalItems}</strong></p>
        </div>
        <div className="summary-card" style={{ flex: 1 }}>
          <h4>Total Stock</h4>
          <p><strong>{totalStock}</strong></p>
        </div>
        <div className="summary-card" style={{ flex: 1 }}>
          <h4>Low Stock</h4>
          <p><strong>{lowStock}</strong></p>
        </div>
      </div>

      <div className="product-cards" style={{ display: 'flex', flexWrap: 'wrap', gap: '1rem', marginTop: '1rem' }}>
        {products.map(p => (
          <div key={p.id} className="product-card" style={{ border: '1px solid #ddd', padding: 10, width: 200 }}>
            <img
              src={p.image || 'https://via.placeholder.com/150?text=No+Image'}
              alt={p.name}
              className="product-image"
              style={{ width: '100%', height: 150, objectFit: 'cover' }}
              onError={handleImageError}
            />
            <div className="product-info" style={{ marginTop: 10 }}>
              <h4>{p.name}</h4>

              <div>
                <label>
                  Quantity:&nbsp;
                  <input
                    type="text"
                    value={editStock[p.id] !== undefined ? editStock[p.id] : p.quantity}
                    onChange={(e) => handleStockChange(p.id, e.target.value)}
                    style={{ width: '60px' }}
                  />
                </label>
                
                 
              
                  
              </div>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
}
